import React from 'react';
import Grid from '@material-ui/core/Grid';
import JournalCard from './JournalCard.jsx';
import MonthBreak from './MonthBreak.jsx';
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles(theme => ({
    root: {
        margin: "0 8rem",
    }
}));

export default function JournalGrid({ data }) {
    const classes = useStyles();


    // const renderEntries = () => (
    //     // Loop through the entries and render a grid 
    //     for(i = 0; i < data.length; ++i) {

    //     }
    //     return entryGridItems;      ;
    return (
        <Grid class={classes.root}>
            <Grid item xs={12} md={4} lg={3}>
                <JournalCard pic="https://img.freepik.com/free-vector/collection-with-flat-summer-fruit_23-2147551070.jpg?size=338&ext=jpg" />
            </Grid>
            <Grid item xs={12} md={4} lg={3}>
                <JournalCard pic="http://pixelartmaker.com/art/5da075d9350e793.png" />
            </Grid >
            <Grid item xs={12} md={4} lg={3}>
                <JournalCard pic="https://cdn.mindful.org/how-to-meditate.jpg?q=80&fm=jpg&fit=crop&w=1920&h=1080" />
            </Grid >
            <Grid item xs={12} md={4} lg={3}>
                <JournalCard pic="https://cdn.mindful.org/how-to-meditate.jpg?q=80&fm=jpg&fit=crop&w=1920&h=1080" />
            </Grid >
            <Grid item xs={12} md={4} lg={3}>
                <JournalCard pic="https://cdn.mindful.org/how-to-meditate.jpg?q=80&fm=jpg&fit=crop&w=1920&h=1080" />
            </Grid >
            {/* <MonthBreak date={new Date()}></MonthBreak> */}
            <MonthBreak ></MonthBreak>
            <Grid item xs={12} md={4} lg={3}>
                <JournalCard pic="https://cdn.mindful.org/how-to-meditate.jpg?q=80&fm=jpg&fit=crop&w=1920&h=1080" />
            </Grid >
        </Grid>
    );
}
